INSERT INTO `blog_posts` (`id`, `user_id`, `title`, `content`, `is_public`, `created_at`) VALUES
(9, 26, 'The Story Telling Person', 'Don\'t forget that gifts often come with costs that go beyond their purchase price. When you purchase a child the latest smartphone, you\'re also committing to a monthly phone bill. When you purchase the latest gaming system, you\'re likely not going to be satisfied with the games that come with it for long and want to purchase new titles to play. When you buy gifts it\'s important to remember that some come with additional costs down the road that can be much more expensive than the initial gift itself.', 1, '2024-07-05 23:34:37'),
(10, 24, 'The lion king is not a good movie.', 'This Disney animated feature follows the adventures of the young lion Simba (Jonathan Taylor Thomas), the heir of his father, Mufasa (James Earl Jones). Simba\'s wicked uncle, Scar (Jeremy Irons), plots to usurp Mufasa\'s throne by luring father and son into a stampede of wildebeests. But Simba escapes, and only Mufasa is killed. Simba returns as an adult (Matthew Broderick) to take back his homeland from Scar with the help of his friends Timon (Nathan Lane) and Pumbaa (Ernie Sabella).', 1, '2024-07-06 03:17:58'),
(12, 24, 'The story of the 5 persons', 'There is a lot to be known about the story of five persons.\r\n', 1, '2024-07-06 06:00:45'),
(14, 30, 'caqdqd', 'cwscqaqcxcaqdx', 1, '2024-07-10 23:50:56'),
